<div class="t m1 x2 h6 yc ff2 fs3 fc2 sc0 ls0 ws0">poste à mi-temps de technicien inf<span class="_ _0"></span>ormatique et/<span class="_ _2"></span>ou de développeur<span class="_ _0"></span>.</div><div class="t m0 x2 h7 yd ff1 fs4 fc3 sc0 ls0 ws0">Pr<span class="_ _0"></span>ésentation</div><div class="t m0 x3 h8 ye ff2 fs1 fc4 sc0 ls0 ws0">F<span class="_ _0"></span>ort de plusieurs années d'<span class="_ _0"></span>expériences r<span class="_ _0"></span>éussies en tant que technicien inf<span class="_ _0"></span>ormatique,</div><div class="t m0 x3 h8 yf ff2 fs1 fc4 sc0 ls0 ws0">autodidacte depuis mes quatr<span class="_ _0"></span>e ans et éternel étudiant, j'<span class="_ _0"></span>ai commencé le par<span class="_ _0"></span>cours</div><div class="t m0 x3 h8 y10 ff2 fs1 fc4 sc0 ls0 ws0">Dév<span class="_ _0"></span>eloppeur Python au sein de l'<span class="_ _0"></span>école leader<span class="_ _0"></span> en Eur<span class="_ _0"></span>ope de la f<span class="_ _0"></span>ormation en ligne</div><div class="t m0 x3 h8 y11 ff2 fs1 fc4 sc0 ls0 ws0">(MOOC) OpenClassr<span class="_ _0"></span>ooms. D'une curiosité dév<span class="_ _0"></span>orante, passionné, enf<span class="_ _0"></span>ant</div><div class="t m0 x3 h8 y12 ff2 fs1 fc4 sc0 ls0 ws0">intellectuellement pr<span class="_ _0"></span>écoce, je pr<span class="_ _0"></span>atique une v<span class="_ _0"></span>eille technologique et scientiﬁque</div><div class="t m0 x3 h8 y13 ff2 fs1 fc4 sc0 ls0 ws0">rigour<span class="_ _0"></span>euse depuis tout jeune. J'<span class="_ _0"></span>ai dév<span class="_ _0"></span>eloppé un goût pr<span class="_ _0"></span>ononcé pour l'histoir<span class="_ _0"></span>e des</div><div class="t m0 x3 h8 y14 ff2 fs1 fc4 sc0 ls0 ws0">sciences et la pr<span class="_ _0"></span>ospective. <span class="_ _0"></span>T<span class="_ _3"></span>oujours à l'affût des technolo<span class="_ _0"></span>gies émergentes qui ser<span class="_ _0"></span>ont</div><div class="t m0 x